('1762','14','8197','Penthouse Gasso Porto Golf',Null,'Meerblick-Penthouse in erster Meereslinie in Santa Ponsa','21231','Penthouse-Apartment über drei Etagen in einer Wohnanlage in erster Linie mit Blick auf Port Adriano und das Meer. Das Apartment hat eine bebaute Fläche von 145 m² plus überdachte Terrassen und freie Terrassen. Verschiedene Golfplätze sind nur wenige Autominuten von dieser Immobilie auf Mallorca entfernt. Der neue Nobelyachthafen von Port Adriano ist in Sichtweite und lädt mit seinen Restaurants und dem Strand zum Verweilen ein.','21232','750000','111','2012-03-05 16:40:57','106','2012-03-05 16:41:18',Null,'1338','121','652',1,'1','0',Null,Null,Null,'21233',Null,'0','0','0',Null,'2015-04-16 11:14:32',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'21234',Null,'21235',Null,'21236',Null,'21237',Null,'21238','0',0,'0');
